import CelebretiesBox from "./CelebretiesBox";
import CelebData from "../celebData";
import Container from "react-bootstrap/Container";
import Col from "react-bootstrap/Col";
import Row from "react-bootstrap/Row";

function MiddlePage() {
  let something = (
    <div>
      {CelebData.map((myCeleb) => {
        return <CelebretiesBox myCelebData={myCeleb} />;
      })}
    </div>
  );
  const result = [];
  for (let i = 0; i < something.length; i += 3) {
    let x = (
      <Container>
        <Row>
          <Col>{something[i]}</Col>
          <Col>{something[i + 1]}</Col>
          <Col>{something[i + 2]}</Col>
        </Row>
      </Container>
    );
    result.push(x);
  }
  return result;
}

export default MiddlePage;
